6 Point Harness is an American [[animation studio]] based in [[Los Angeles]] that develops and produces animated television programming, feature films, commercial, music videos and web-based content. Founded by Brendan Burch in 2003, some of the studio's most notable productions include [[Tom Hanks]]' [[Electric City (web series)|Electric City]],<ref name="arrant">{{cite web | last=Arrant | first=Chris | title=Joel Trussell On Directing Tom Hanks' New Webseries "Electric City" | website=Cartoon Brew | date=July 17, 2012 | url=https://www.cartoonbrew.com/animators/joel-trussell-talks-about-directing-tom-hanks-new-webseries-electric-city-66379.html | access-date=September 2, 2021}}</ref> [[Fox Broadcasting Company|Fox]]'s [[Cosmos: A Spacetime Odyssey]], [[MTV]]'s [[Good Vibes (U.S. TV series)|Good Vibes]], [[Nick Jr.]]'s [[Wow! Wow! Wubbzy!]], [[Nickelodeon]]'s [[El Tigre: The Adventures of Manny Rivera]], [[Adult Swim]]'s [[Apollo Gauntlet]] and [[Lazor Wulf]], the animated feature [[The Drawn Together Movie: The Movie!]], and the web series [[Dick Figures]] for the [[YouTube]] channel [[Mondo Media]].<ref>{{cite web |title=Six Point Harness |url=https://www.imdb.com/company/co0120568/?ref_=fn_al_co_1 |work=IMDB |date=December 7, 2012}}</ref> 6PH also released [[Dick Figures: The Movie]], an in-house production developed from the company's web series.<ref>{{cite web |title=Dick Figures: The Movie |url=https://www.imdb.com/title/tt2312262/ |work=IMDB |access-date=September 13, 2013}}</ref>

On September 19, 2016, it was announced that 6 Point Harness merged with Mondo Media. <ref>{{Cite web |last=Amidi |first=Amid |date=2016-09-19 |title=Mondo Media and Six Point Harness Finalize Merger |url=https://www.cartoonbrew.com/studios/mondo-media-six-point-harness-finalize-merger-143145.html |access-date=2023-03-30 |website=Cartoon Brew |language=en-US}}</ref>

